import { Link } from "react-router-dom";

export default function MessageBox(props) {
  return (
    <div>
      <Link to="/">Back to result</Link>

      <div className={`alert alert-${props.variant || "info"}`}>
        {props.children}
      </div>
      </div>
  );
}
